package main

func numSub(s string) int {
	var subs []int
	var cur int
	for _, str := range []byte(s) {
		if string(str) == "1" {
			cur += 1
		} else {
			subs = append(subs, cur)
			cur = 0
		}
	}
	if cur != 0 {
		subs = append(subs, cur)
	}
	print(subs)
	res := 0
	for _, sub := range subs {
		res += sub * (sub + 1) / 2
	}
	return res % 1000000007
}

func main() {
	//numSub("0110111")
	//numSub("111111")
	numSub("")
}
